import React from 'react';
import {NavLink} from "react-router-dom";
// import styles from './HeaderNav.module.scss'
import styled from 'styled-components'

const List = styled.li`
  
`
const ListItem = styled.li`
  list-style: none;
  display: inline-block;
  margin-right: 50px;
  max-width: 120px;
  height: 100%;
  color: white;
  &.active {
    background-color: red;
  }
  &Link {
    text-decoration: none;
    &Active {
      font-weight: 700;
      background-color: #2D5283;
    }
  };

`


const HeaderNav = () => (
    <nav>
        <List>
            <ListItem as={NavLink} to="/" activeclass="active">start </ListItem>
            <ListItem as={NavLink} to="/edit" activeclass="active">edytuj </ListItem>
            <ListItem as={NavLink} to="/add" activeclass="active">dodaj </ListItem>
            <ListItem as={NavLink} to="/list" activeclass="active">lista </ListItem>
            <ListItem as={NavLink} to="/settings" activeclass="active">ustawienia </ListItem>
        </List>
    </nav>
);

export default HeaderNav;
